import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { createBooking } from '../services/bookingService';
import { getVehicles } from '../services/vehicleService';

const Book = () => {
  const { id } = useParams(); // Get vehicle ID from URL
  const navigate = useNavigate();
  const [vehicles, setVehicles] = useState([]);
  const [vehicleId, setVehicleId] = useState(id || '');
  const [selectedVehicle, setSelectedVehicle] = useState(null);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [success, setSuccess] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  // Mock vehicles data (same as VehicleList)
  const mockVehicles = [
    {
      _id: '1',
      name: 'Mercedes-Benz S-Class',
      category: 'luxury',
      description: 'Experience ultimate luxury with our premium Mercedes-Benz S-Class.',
      pricePerDay: 299,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1563720223185-11003d516935?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80'
    },
    {
      _id: '2',
      name: 'BMW M4 Coupe',
      category: 'sports',
      description: 'Feel the thrill of driving with our high-performance BMW M4 Coupe.',
      pricePerDay: 399,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1555215695-3004980ad54e?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80'
    },
    {
      _id: '3',
      name: 'Range Rover Evoque',
      category: 'suv',
      description: 'Conquer any terrain with style in our luxurious Range Rover Evoque.',
      pricePerDay: 249,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1606664515524-ed2f786a0bd6?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80'
    },
    {
      _id: '4',
      name: 'Tesla Model S',
      category: 'luxury',
      description: 'Experience the future of driving with our Tesla Model S.',
      pricePerDay: 349,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1560958089-b8a1929cea89?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80'
    }
  ];

  useEffect(() => {
    // Use mock data for now
    setVehicles(mockVehicles);

    // If vehicle ID is provided in URL, find and set the selected vehicle
    if (id) {
      const vehicle = mockVehicles.find(v => v._id === id);
      if (vehicle) {
        setSelectedVehicle(vehicle);
        setVehicleId(id);
      }
    }
  }, [id]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Check if user is logged in
    const token = localStorage.getItem('token');
    if (!token) {
      setError('Please log in to make a booking.');
      navigate('/login');
      return;
    }

    // Validate dates
    const today = new Date().toISOString().split('T')[0];
    if (startDate < today) {
      setError('Pickup date cannot be in the past.');
      return;
    }
    if (endDate <= startDate) {
      setError('Return date must be after pickup date.');
      return;
    }

    setLoading(true);
    setError('');
    setSuccess('');

    try {
      // For now, simulate booking creation
      // await createBooking({ vehicle: vehicleId, startDate, endDate });

      // Simulate API delay
      await new Promise(resolve => setTimeout(resolve, 1500));

      setSuccess('Booking submitted successfully! Your booking is pending confirmation.');
      setStartDate('');
      setEndDate('');
    } catch (err) {
      setError(err.response?.data?.message || 'Booking failed');
    }
    setLoading(false);
  };

  return (
    <div className="container py-5">
      <h1 className="text-center mb-2" style={{ fontWeight: 700 }}>Book a Car</h1>
      <p className="text-center mb-4 text-muted" style={{ fontSize: '1.2rem' }}>Make your reservation today</p>
      <div className="d-flex justify-content-center">
        <form className="bg-white p-4 rounded shadow" style={{ minWidth: 400, maxWidth: 500 }} onSubmit={handleSubmit}>
          {success && <div className="alert alert-success">{success}</div>}
          {error && <div className="alert alert-danger">{error}</div>}
          <div className="row mb-3">
            <div className="col-12 mb-3">
              <label className="form-label fw-bold">Select Car</label>
              <select className="form-select" value={vehicleId} onChange={e => setVehicleId(e.target.value)} required>
                <option value="">Choose a car</option>
                {vehicles.map(v => (
                  <option key={v._id} value={v._id}>{v.name}</option>
                ))}
              </select>
            </div>
            <div className="col-md-6 mb-3">
              <label className="form-label fw-bold">Pickup Date</label>
              <input type="date" className="form-control" value={startDate} onChange={e => setStartDate(e.target.value)} required />
            </div>
            <div className="col-md-6 mb-3">
              <label className="form-label fw-bold">Return Date</label>
              <input type="date" className="form-control" value={endDate} onChange={e => setEndDate(e.target.value)} required />
            </div>
          </div>
          <button type="submit" className="btn btn-primary w-100" disabled={loading}>{loading ? 'Submitting...' : 'SUBMIT BOOKING'}</button>
        </form>
      </div>
    </div>
  );
};

export default Book;
